import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open the cart modal
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for cart modal to appear and take screenshot
    await page.waitForSelector('#cartModal', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_modal.png'));

    // Increase quantity of first item in cart
    await page.waitForSelector('.cart-item:first-child .quantity-btn:last-child', { timeout: 5000 });
    await page.click('.cart-item:first-child .quantity-btn:last-child');

    // Wait for quantity to update and take screenshot
    await page.waitForTimeout(1000); // Wait for UI update
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_quantity_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_quantity_updated.png'));

    // Extract updated quantity and total
    const quantity = await page.textContent('.cart-item:first-child .quantity');
    const total = await page.textContent('#cartTotal');

    return {
      success: true,
      action: "Updated cart item quantity by increasing quantity by 1",
      extractedData: {
        quantity: quantity.trim(),
        total: total.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to update cart item quantity",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
